KUALA LUMPUR , Jul 10 (APP): Deputy Prime Minister and Foreign Minister (DPM/FM), Senator Mohammad Ishaq Dar on Thursday inaugurated the Pakistan Mango Festival in Kuala Lumpur, organised by the High Commission of Pakistan.
The festival intended to celebrate the richness of Pakistan’s mangoes and promoting agri-trade and cultural diplomacy, a DPM’s Office news release said.
